INSERT INTO `t_activity` VALUES (1, '定向越野', '定向越野运动是一项非常健康的智慧型体育项目,智力与体力并重的运动。参赛者利用地图和指南针到访地图上所指示的各个点标,自己选择行进路线,依次寻找各个检查点的“宝物”,用最短时间完成比赛者为优胜.通常设在森林,郊外和城市公园里进行,也可在大学校园里进行.', '2020-12-12 16:00:00', '2021-01-07 16:00:00', 17, 1, 2, 55, '213', '2020-12-30 12:49:24', '2021-01-13 11:52:43');
INSERT INTO `t_activity` VALUES (2, '毅行活动', '人员自由组合，4人一组，每组自行选出一名组长，全组在活动规定的时间内，走完活动预设的路线路程。活动过程中每个参赛者必须以自己的小组为单位，全组共进退进行活动，而活动本身也是依该组是否所有队员同时出发同时到达终点来衡量你是否是一名毅行者。', '2020-11-29 16:00:00', '2021-01-15 16:00:00', 16, 1, 0, 55, 'www', '2020-12-30 15:41:55', '2021-01-13 12:40:12');
INSERT INTO `t_activity` VALUES (3, '读书征文比赛', '活动形式是读书征文比赛，指定书目是:《省委书记》、《绝顶》、《激情燃烧的岁月》、《绝不放过你》、《民办大学生》、《非常日记》、《桃李》。这7本书在当年多数是很有影响的作品。其中的《民办大学生》虽然并没有什么名气，但对我校这样尚未被全社会认可的民办高校来说，学生们读起来却倍感亲切。这部书真实地描写了民办大学生的发奋自强、与命运的抗争，以及他们的辛酸。张海迪的长篇小说《绝顶》给了我们的学生战胜困难的勇气和勇攀高峰的信心。', '2020-12-15 16:00:00', '2020-12-19 16:00:00', 19, 1, 0, 55, '嘿嘿嘿', '2020-12-31 11:47:42', '2021-01-13 12:36:06');
INSERT INTO `t_activity` VALUES (4, '线上预约保养服务', '【用例UST004：线上预约保养服务】\n\n1）用户选择“去保养”后，进入预约保养页面；\n\n2）点击后选择保养时间，后台查询是否有货，根据是否有无货品做出对应的操作；\n\n3）根据用户购买保养包类型及数量，组合计算“保养预计时长”；客户也可以选择希望取车时间，可选择时间段需>“保养预计时长”；\n\n4）用户可选择保养预约时间，可查看每日可提供预约时间段及预约情况，并支持时间段备注信息，如“线下好评赠百元红包”等内容，点击“预约”按钮提示预约成功，请准时到场；\n\n5）车辆注册方式：1.上传行驶证，通过ocr识别；2.手工输入车牌号；\n\n6）输入：公里数、联系人、手机号、是否上门取送车、发票信息收集（如开发票，则收集发票类型和抬头）\n\n7）点击预约提交后，展示预提交页面，供用户确认，无误后点击确定，提交给moby系统。', '2020-12-31 16:00:00', '2021-01-15 16:00:00', 20, 1, 1, 55, '体育场', '2021-01-02 04:16:06', '2021-01-13 11:53:08');
