INSERT INTO `t_news` VALUES (1, '学院足球俱乐部通过“浙江省高校省级校园足球俱乐部”认定', '<p>2020年12月23日，浙江省教育厅发布《浙江省教育厅办公室关于公布2020年浙江省高校省级校园足球俱乐部名单的通知》，我院“杭电信工联”足球俱乐部被认定为“浙江省高校省级校园足球俱乐部”。</p><p>2020年浙江省高校开展的高校省级校园足球俱乐部的创建遴选工作，旨在深入贯彻落实《中国足球改革发展总体方案》《教育部等6部门关于加快发展青少年校园足球的实施意见》精神，全面贯彻党的教育方针，促进我省青少年校园足球工作向纵深发展，落实浙江省人民政府办公厅《关于印发浙江省重大建设项目“十三五”规划的通知》提出的“十三五”期间建设100个高校学生校园足球俱乐部的规划目标。省教育厅要求全省各高校足球俱乐部根据《2020年浙江省高校省级校园足球俱乐部创建工作的通知》（浙教办函〔2020〕224号）的要求,从组织领导、条件保障、训练与竞赛、文化氛围和特色创新等五个方面，对校园足球俱乐部的建设进行自评、打分，通过学校审核推荐上报至省教育厅进行考评和认定。</p><p>学院自接到通知以来，在学院副院长徐毅鹏的鼎力支持下，体育教学部与“信工联”足球俱乐部按照省教育厅的要求，从俱乐部的组织领导、条件保障、训练与竞赛、文化氛围和特色创新等五个方面着手，努力完善和落实各项指标，通过自评、学院推荐，我院“杭电信工联”足球俱乐部与浙江大学、宁波大学、杭州电子科技大学等高校的校园足球俱乐部获得了省教育厅的认定。</p><p>“杭电信工联”足球俱乐部将以本次“省级校园足球俱乐部的创建遴选工作”为契机，以评促建，进一步加大投入，致力打造一个“符合人才成长规律、大学生广泛参与、运动水平持续提升、体制机制充满活力、基础条件保障有力、文化氛围蓬勃向上”的高校校园足球俱乐部。</p><p><font face=\"sans-serif\"></font><br></p><p><img width=\"700\" height=\"467\" title=\"1609128501301040.jpg\" alt=\"1609128501301040.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609128501301040.jpg\"></p>', 17, NULL, 1, 1, '2020-12-30 09:00:23', '2020-12-30 09:00:23');
INSERT INTO `t_news` VALUES (2, '我院行政第四党支部开展“反对铺张浪费，倡导光盘行动”主题党日活动', '<p>12月15日-27日，我院行政第四党支部以实际行动响应“节约粮食，反对浪费”的号召，开展为期两周的“反对铺张浪费，倡导光盘行动”主题党日活动，支部全体党员参与此次活动。</p><p><br></p><p><img width=\"700\" height=\"467\" title=\"\" alt=\"1609136488917829.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609136488917829.jpg\" style=\"\"></p><p><br></p><p>活动开始后，全体党员来到学院食堂各楼层收盘处值岗，致力于让全体师生树立节约光荣、浪费可耻的意识，就餐时提倡爱惜粮食，科学点餐，按需取用，践行“光盘行动”，培养节约粮食的习惯。养成健康文明、科学合理的用餐习惯，摒弃大吃大喝、暴饮暴食等不健康行为，从点滴中自觉培养科学健康的生活方式。</p><p>活动初期，铺张浪费现象时有发生，尤其是在学生群体中较为常见，支部党员对此现象进行调研与劝导，绝大部分被劝导的学生表示羞愧并接受了劝导。也有学生表示，食堂阿姨打的饭菜太多是他们吃不完的一个原因。对此，一方面党员们劝导学生在打饭时要向阿姨强调自身的食量，做到既吃饱又不浪费；另一方面，支部也向食堂反应了这个情况，食堂也很快推出了半份饭菜，并且嘱咐食堂阿姨在打饭时“因人而异”，做到适度适量。得益于类似的各种措施，在之后几天特别是第二周的活动中，浪费现象减少的十分明显，原先出现过整盘饭菜都倒掉的现象已经基本消失，现在送到餐具回收点的餐盘里，也鲜有食物残留的“身影”。食堂阿姨们均表示，学生们的浪费情况得到了很大的改善，每天装食物残渣的泔水桶也少了。</p><p><br></p><p><img width=\"700\" height=\"467\" title=\"\" alt=\"1609136521150737.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609136521150737.jpg\" style=\"\"></p><p><br></p><p>最终，在全体党支部成员不懈的努力下，本次主题活动圆满结束，之后也将不定时抽查，继续响应国家的号召。全体党员以自身行动争做“光盘行动”带头人，坚决抵制餐饮浪费行为，充分体现了支部党员们的使命感，为学院的发展做出了自己的行动，为国家的进步贡献了自己的力量！</p><p><br></p><p><img width=\"700\" height=\"467\" title=\"1609136469521985.jpg\" alt=\"1609136469521985.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609136469521985.jpg\"></p>', 14, NULL, 1, 1, '2020-12-30 13:11:52', '2020-12-30 09:01:14');
INSERT INTO `t_news` VALUES (3, '湖畔之光 燃染信梦！我院第二届主题灯展活动圆满结束', '<p>用灯点亮校园，让光温暖冬季，12月23日晚，冬日“湖畔之光，燃染信梦”主题灯展在我院格致楼喷泉广场如期开展。本次活动灯盏作品全部由电子工程学院学生自己动手制作完成，为冬日校园增添了一道温暖的风景线。</p><p><br></p><p><img width=\"700\" height=\"467\" title=\"\" alt=\"1609135326370428.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135326370428.jpg\" style=\"\"></p><p><br></p><p>本次灯盏共收集团队和个人作品60余件，将喷泉广场点缀一新。同时，本次灯展增设了猜灯谜以及书写心愿墙的活动，极大增强了参观灯展同学的参与度及积极性。</p><p>走过绚烂的星空走廊，行至在心愿墙边，同学们写下了对现在，对未来的各种期许。各式各样精彩的作品更是成为了大家争相打卡拍照的地点，每一盏灯都是作者团队灵感的展现，心血的灌注，同学的肯定便是对大家作品最大的鼓励，每一张投下的票都是对作品的赞扬。</p><p><br></p><p><img width=\"700\" height=\"467\" title=\"1609135355308221.jpg\" alt=\"1609135355308221.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135355308221.jpg\"></p><p><br></p><p>灯展作品经过线下及线上两种渠道评选，通过激烈的评比，最终有5个作品脱颖而出，获得了此次灯展比赛的一等奖。它们分别是19电信1班的“浴球”、19电信4班的“傻不愣灯”、18电信2班的“财源广进”、18通信1班的“光立方”、18电信8班的“墨华烛”。</p><p>&nbsp;</p><p><img width=\"700\" height=\"467\" title=\"1609135395796962.jpg\" alt=\"1609135395796962.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135395796962.jpg\"></p><p><br></p><p><img width=\"700\" height=\"467\" title=\"1609135381166101.jpg\" alt=\"1609135381166101.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135381166101.jpg\"><br></p><p><br></p><p>最后，电子工程学院辅导员胡锦彤主持颁奖仪式，学院党委宣传部、后勤基建部、学生工作部、团委及各二级学院相关老师给获奖团队颁奖。</p><p>&nbsp;</p><p><img width=\"700\" height=\"467\" title=\"1609135424884993.jpg\" alt=\"1609135424884993.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135424884993.jpg\"></p><p><br></p><p>本次灯展由电子工程学院分团委主办，电子工程学院学生会承办。灯光渐去，幸福的回忆却可留在心间，温暖寒冬；霓虹闪耀，美丽的图像定可永驻脑海，回想不停。第二届“湖畔之光，燃染信梦”主题灯展圆满结束。</p><p>&nbsp;<br></p><p><img width=\"700\" height=\"467\" title=\"1609135424309926.jpg\" alt=\"1609135424309926.jpg\" src=\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135424309926.jpg\"></p>', 17, NULL, 1, 0, '2020-12-31 12:06:07', '2020-12-30 09:02:18');
