INSERT INTO `t_position` VALUES (13, '马克思主义学社', '求是学会暨“三个代表”重要思想学习研究会（简称研究会）是学校“三个代表”重要思想研究会的分支机构，是在院党总支领导下，团总支指导下的作为广大同学思想阵地的学生组织。求是学会用理论研究分析同学们关心的社会热点问题，并通过形式多样、丰富多彩的活动形成学习政治理论的良好氛围，致力于提高同学们的综合素质和政治修养。', '2021-01-13 13:27:31', '2019-09-05 14:40:03');
INSERT INTO `t_position` VALUES (14, '辩论社', '本社团于千禧年初创建，是面向全校学生，集学术性、实践性和应用性为一体的协会。协会本着“与祖国同行，与时代共进”的思想，以“推动学校文化建设，丰富学生文化生活”为目的，秉持着“帮助学生培养社交技巧、增强语言表达能力、切实促进演讲与口才方面的进步”的宗旨，为广大演讲与口才爱好者提供了一个交流与展示的平台。', '2021-01-13 13:25:50', '2019-09-05 14:40:09');
INSERT INTO `t_position` VALUES (15, '设计社', '专门为设计而生 独立且拥有商业平台，提供设计技能的学习。用设计协会这样的平台来提供更好的技能历练的机会；帮助对设计感兴趣的学生了解设计相关的行业；提高众人的审美观及改善生活质量。', '2021-01-13 13:24:23', '2019-09-05 14:40:19');
INSERT INTO `t_position` VALUES (16, '汽车爱好者社', '本社团是一支较为年轻的协会。由一群汽车爱好者为开拓技术视野,丰富校园生活,增长专业知识, 发掘培养汽车技能型人才而成立。注重知识的积累和技术创新，同时会将复杂的专业知识以简单的方式介绍给大家。以普及汽车知识，宣扬汽车文化，致力于与汽车爱好者及研究者共同探索汽车奥秘，培养创新意识及实践动手能力和培养机电创新人才的宗旨竭力为广大车迷提供一个学习与交流的平台。', '2021-01-13 13:24:27', '2019-11-06 15:58:37');
INSERT INTO `t_position` VALUES (17, '三维成图社', '三维成图社团可以培养同学们对机械制图和计算机绘图的浓厚兴趣，同时为全国大学生先进成图技术与产品信息建模创新大赛选拔更多人才；其次，也可以提高同学们的尺规绘图能力和计算机绘图能力，对三维成图有兴趣的同学互相交流，共同学习；而且三维成图爱好者协会是由软件及尺规绘图爱好者成立的团体，为对三维成图技术有着浓厚兴趣的同学打造一个学习交流的平台。\n\n行动起来，一起加入我们吧。', '2021-01-13 13:24:30', '2019-11-15 17:04:40');
INSERT INTO `t_position` VALUES (18, '足球社', '　为普及足球知识和技能，形成校园足球文化，从而培养全面发展、特长突出的足球后备人才。我校成立了足球社团。由XXX老师担任教练。旨在提高学生的身体素质和技术技能水平，培养学生拼搏进取、团结协作的体育精神。', '2021-01-13 13:30:19', '2020-12-31 13:27:02');
INSERT INTO `t_position` VALUES (19, '篮球社', '篮球协会以本着活跃校园气氛加强体育锻炼的目的，以普及篮球基础知识、承办各级篮球赛事、丰富学生课余文化生活为宗旨的社团组织。虽然我们也许不能让每一个会员都成为顶尖的篮球高手,但我们一定会让篮球协会的每一名成员从篮球运动中获得快乐,体会到篮球运动的无穷魅力.在这里你不但可以提高你的篮球技术,还可以交到许多知心朋友,每年我们都会组织各种各样的训练与比赛,加入篮球协会一定会让你的学生生活更加丰富多彩。', '2021-01-13 13:29:11', '2020-12-31 14:40:54');
INSERT INTO `t_position` VALUES (20, '夜跑社', '夜跑社，旨在指导督促同学们进行夜跑，以更好的身体状态和精神面貌迎接学习与生活。夜跑社将统计社员的夜跑目标与执行情况，通过适当的奖励来鼓励和督促社员，同时，为志同道合的跑友提供认识与互动的平台，为想要减肥健身却行动力不足的同学提供帮带督促服务。不仅如此，社团还会提供一些关于正确跑步的指导，以及运动相关的小贴士，让大家跑出健康！', '2021-01-13 13:31:50', '2020-12-31 14:50:00');
INSERT INTO `t_position_approve` VALUES (1, '夜跑社', '夜间长跑', 3, 1, 1, '2020-12-31 15:45:55', '2020-12-31 14:50:00');
