INSERT INTO `t_user_operate_log` VALUES (36, 1, '管理员', '通用-新闻', '添加', '/smart-admin-api/news/add', 'net.lab1024.smartadmin.module.business.news.NewsController.add', 'NewsAddDTO[{\"newsText\":\"<p>2020年12月23日，浙江省教育厅发布《浙江省教育厅办公室关于公布2020年浙江省高校省级校园足球俱乐部名单的通知》，我院“杭电信工联”足球俱乐部被认定为“浙江省高校省级校园足球俱乐部”。</p><p>2020年浙江省高校开展的高校省级校园足球俱乐部的创建遴选工作，旨在深入贯彻落实《中国足球改革发展总体方案》《教育部等6部门关于加快发展青少年校园足球的实施意见》精神，全面贯彻党的教育方针，促进我省青少年校园足球工作向纵深发展，落实浙江省人民政府办公厅《关于印发浙江省重大建设项目“十三五”规划的通知》提出的“十三五”期间建设100个高校学生校园足球俱乐部的规划目标。省教育厅要求全省各高校足球俱乐部根据《2020年浙江省高校省级校园足球俱乐部创建工作的通知》（浙教办函〔2020〕224号）的要求,从组织领导、条件保障、训练与竞赛、文化氛围和特色创新等五个方面，对校园足球俱乐部的建设进行自评、打分，通过学校审核推荐上报至省教育厅进行考评和认定。</p><p>学院自接到通知以来，在学院副院长徐毅鹏的鼎力支持下，体育教学部与“信工联”足球俱乐部按照省教育厅的要求，从俱乐部的组织领导、条件保障、训练与竞赛、文化氛围和特色创新等五个方面着手，努力完善和落实各项指标，通过自评、学院推荐，我院“杭电信工联”足球俱乐部与浙江大学、宁波大学、杭州电子科技大学等高校的校园足球俱乐部获得了省教育厅的认定。</p><p>“杭电信工联”足球俱乐部将以本次“省级校园足球俱乐部的创建遴选工作”为契机，以评促建，进一步加大投入，致力打造一个“符合人才成长规律、大学生广泛参与、运动水平持续提升、体制机制充满活力、基础条件保障有力、文化氛围蓬勃向上”的高校校园足球俱乐部。</p><p><font face=\\\"sans-serif\\\"></font><br></p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"1609128501301040.jpg\\\" alt=\\\"1609128501301040.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609128501301040.jpg\\\"></p>\",\"newsTitle\":\"学院足球俱乐部通过“浙江省高校省级校园足球俱乐部”认定\",\"positionId\":17,\"status\":1}]', 1, NULL, '2020-12-30 17:00:22', '2020-12-30 17:00:22');
