INSERT INTO `t_user_operate_log` VALUES (40, 1, '管理员', '通用-新闻', '添加', '/smart-admin-api/news/add', 'net.lab1024.smartadmin.module.business.news.NewsController.add', 'NewsAddDTO[{\"newsText\":\"<p>12月15日-27日，我院行政第四党支部以实际行动响应“节约粮食，反对浪费”的号召，开展为期两周的“反对铺张浪费，倡导光盘行动”主题党日活动，支部全体党员参与此次活动。</p><p><br></p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"\\\" alt=\\\"1609136488917829.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609136488917829.jpg\\\" style=\\\"\\\"></p><p><br></p><p>活动开始后，全体党员来到学院食堂各楼层收盘处值岗，致力于让全体师生树立节约光荣、浪费可耻的意识，就餐时提倡爱惜粮食，科学点餐，按需取用，践行“光盘行动”，培养节约粮食的习惯。养成健康文明、科学合理的用餐习惯，摒弃大吃大喝、暴饮暴食等不健康行为，从点滴中自觉培养科学健康的生活方式。</p><p>活动初期，铺张浪费现象时有发生，尤其是在学生群体中较为常见，支部党员对此现象进行调研与劝导，绝大部分被劝导的学生表示羞愧并接受了劝导。也有学生表示，食堂阿姨打的饭菜太多是他们吃不完的一个原因。对此，一方面党员们劝导学生在打饭时要向阿姨强调自身的食量，做到既吃饱又不浪费；另一方面，支部也向食堂反应了这个情况，食堂也很快推出了半份饭菜，并且嘱咐食堂阿姨在打饭时“因人而异”，做到适度适量。得益于类似的各种措施，在之后几天特别是第二周的活动中，浪费现象减少的十分明显，原先出现过整盘饭菜都倒掉的现象已经基本消失，现在送到餐具回收点的餐盘里，也鲜有食物残留的“身影”。食堂阿姨们均表示，学生们的浪费情况得到了很大的改善，每天装食物残渣的泔水桶也少了。</p><p><br></p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"1609136521150737.jpg\\\" alt=\\\"1609136521150737.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609136521150737.jpg\\\"></p><p><br></p><p>最终，在全体党支部成员不懈的努力下，本次主题活动圆满结束，之后也将不定时抽查，继续响应国家的号召。全体党员以自身行动争做“光盘行动”带头人，坚决抵制餐饮浪费行为，充分体现了支部党员们的使命感，为学院的发展做出了自己的行动，为国家的进步贡献了自己的力量！</p><p><br></p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"1609136469521985.jpg\\\" alt=\\\"1609136469521985.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609136469521985.jpg\\\"></p>\",\"newsTitle\":\"我院行政第四党支部开展“反对铺张浪费，倡导光盘行动”主题党日活动\",\"positionId\":16,\"status\":1}]', 1, NULL, '2020-12-30 17:01:14', '2020-12-30 17:01:14');
