INSERT INTO `t_user_operate_log` VALUES (1562, 1, '管理员', '通用-新闻', '修改', '/smart-admin-api/news/update', 'net.lab1024.smartadmin.module.business.news.NewsController.update', 'NewsUpdateDTO[{\"id\":3,\"newsText\":\"<p>用灯点亮校园，让光温暖冬季，12月23日晚，冬日“湖畔之光，燃染信梦”主题灯展在我院格致楼喷泉广场如期开展。本次活动灯盏作品全部由电子工程学院学生自己动手制作完成，为冬日校园增添了一道温暖的风景线。</p><p><br></p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"\\\" alt=\\\"1609135326370428.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135326370428.jpg\\\" style=\\\"\\\"></p><p><br></p><p>本次灯盏共收集团队和个人作品60余件，将喷泉广场点缀一新。同时，本次灯展增设了猜灯谜以及书写心愿墙的活动，极大增强了参观灯展同学的参与度及积极性。</p><p>走过绚烂的星空走廊，行至在心愿墙边，同学们写下了对现在，对未来的各种期许。各式各样精彩的作品更是成为了大家争相打卡拍照的地点，每一盏灯都是作者团队灵感的展现，心血的灌注，同学的肯定便是对大家作品最大的鼓励，每一张投下的票都是对作品的赞扬。</p><p><br></p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"1609135355308221.jpg\\\" alt=\\\"1609135355308221.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135355308221.jpg\\\"></p><p><br></p><p>灯展作品经过线下及线上两种渠道评选，通过激烈的评比，最终有5个作品脱颖而出，获得了此次灯展比赛的一等奖。它们分别是19电信1班的“浴球”、19电信4班的“傻不愣灯”、18电信2班的“财源广进”、18通信1班的“光立方”、18电信8班的“墨华烛”。</p><p>&nbsp;</p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"1609135395796962.jpg\\\" alt=\\\"1609135395796962.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135395796962.jpg\\\"></p><p><br></p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"1609135381166101.jpg\\\" alt=\\\"1609135381166101.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135381166101.jpg\\\"><br></p><p><br></p><p>最后，电子工程学院辅导员胡锦彤主持颁奖仪式，学院党委宣传部、后勤基建部、学生工作部、团委及各二级学院相关老师给获奖团队颁奖。</p><p>&nbsp;</p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"1609135424884993.jpg\\\" alt=\\\"1609135424884993.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135424884993.jpg\\\"></p><p><br></p><p>本次灯展由电子工程学院分团委主办，电子工程学院学生会承办。灯光渐去，幸福的回忆却可留在心间，温暖寒冬；霓虹闪耀，美丽的图像定可永驻脑海，回想不停。第二届“湖畔之光，燃染信梦”主题灯展圆满结束。</p><p>&nbsp;<br></p><p><img width=\\\"700\\\" height=\\\"467\\\" title=\\\"1609135424309926.jpg\\\" alt=\\\"1609135424309926.jpg\\\" src=\\\"http://www.hziee.edu.cn/ueditor/php/upload/image/20201228/1609135424309926.jpg\\\"></p>\",\"newsTitle\":\"湖畔之光 燃染信梦！我院第二届主题灯展活动圆满结束\",\"positionId\":17,\"status\":0}]', 1, NULL, '2020-12-31 20:06:07', '2020-12-31 20:06:07');
