INSERT INTO `t_user_operate_log` VALUES (2362, 1, '管理员', '通用-活动', '更新活动', '/smart-admin-api/activity/update', 'net.lab1024.smartadmin.module.business.activity.ActivityController.updateActivity', 'ActivityUpdateDTO[{\"activityMaximum\":55,\"activityName\":\"线上预约保养服务\",\"activityRemark\":\"【用例UST004：线上预约保养服务】\\n\\n1）用户选择“去保养”后，进入预约保养页面；\\n\\n2）点击后选择保养时间，后台查询是否有货，根据是否有无货品做出对应的操作；\\n\\n3）根据用户购买保养包类型及数量，组合计算“保养预计时长”；客户也可以选择希望取车时间，可选择时间段需>“保养预计时长”；\\n\\n4）用户可选择保养预约时间，可查看每日可提供预约时间段及预约情况，并支持时间段备注信息，如“线下好评赠百元红包”等内容，点击“预约”按钮提示预约成功，请准时到场；\\n\\n5）车辆注册方式：1.上传行驶证，通过ocr识别；2.手工输入车牌号；\\n\\n6）输入：公里数、联系人、手机号、是否上门取送车、发票信息收集（如开发票，则收集发票类型和抬头）\\n\\n7）点击预约提交后，展示预提交页面，供用户确认，无误后点击确定，提交给moby系统。\",\"id\":4,\"place\":\"体育场\",\"startTime\":1609430400000,\"stopTime\":1610726400000}]', 1, NULL, '2021-01-13 11:53:08', '2021-01-13 11:53:08');
