INSERT INTO `t_user_operate_log` VALUES (2385, 1, '管理员', '通用-活动', '更新活动', '/smart-admin-api/activity/update', 'net.lab1024.smartadmin.module.business.activity.ActivityController.updateActivity', 'ActivityUpdateDTO[{\"activityMaximum\":55,\"activityName\":\"读书征文比赛\",\"activityRemark\":\"活动形式是读书征文比赛，指定书目是:《省委书记》、《绝顶》、《激情燃烧的岁月》、《绝不放过你》、《民办大学生》、《非常日记》、《桃李》。这7本书在当年多数是很有影响的作品。其中的《民办大学生》虽然并没有什么名气，但对我校这样尚未被全社会认可的民办高校来说，学生们读起来却倍感亲切。这部书真实地描写了民办大学生的发奋自强、与命运的抗争，以及他们的辛酸。张海迪的长篇小说《绝顶》给了我们的学生战胜困难的勇气和勇攀高峰的信心。\",\"id\":3,\"place\":\"嘿嘿嘿\",\"startTime\":1608048000000,\"stopTime\":1606838400000}]', 1, NULL, '2021-01-13 12:12:07', '2021-01-13 12:12:07');
