INSERT INTO `t_user_operate_log` VALUES (2448, 1, '管理员', '通用-社团', '更新社团', '/smart-admin-api/position/update', 'net.lab1024.smartadmin.module.system.position.PositionController.updateJob', 'PositionUpdateDTO[{\"id\":16,\"positionName\":\"汽车爱好者社\",\"remark\":\"本社团是一支较为年轻的协会。由一群汽车爱好者为开拓技术视野,丰富校园生活,增长专业知识, 发掘培养汽车技能型人才而成立。注重知识的积累和技术创新，同时会将复杂的专业知识以简单的方式介绍给大家。以普及汽车知识，宣扬汽车文化，致力于与汽车爱好者及研究者共同探索汽车奥秘，培养创新意识及实践动手能力和培养机电创新人才的宗旨竭力为广大车迷提供一个学习与交流的平台。\"}]', 1, NULL, '2021-01-13 13:24:27', '2021-01-13 13:24:27');
