INSERT INTO `t_user_operate_log` VALUES (2451, 1, '管理员', '通用-社团', '更新社团', '/smart-admin-api/position/update', 'net.lab1024.smartadmin.module.system.position.PositionController.updateJob', 'PositionUpdateDTO[{\"id\":17,\"positionName\":\"三维成图社\",\"remark\":\"三维成图社团可以培养同学们对机械制图和计算机绘图的浓厚兴趣，同时为全国大学生先进成图技术与产品信息建模创新大赛选拔更多人才；其次，也可以提高同学们的尺规绘图能力和计算机绘图能力，对三维成图有兴趣的同学互相交流，共同学习；而且三维成图爱好者协会是由软件及尺规绘图爱好者成立的团体，为对三维成图技术有着浓厚兴趣的同学打造一个学习交流的平台。\\n\\n行动起来，一起加入我们吧。\"}]', 1, NULL, '2021-01-13 13:24:30', '2021-01-13 13:24:30');
