INSERT INTO `t_user_operate_log` VALUES (2462, 1, '管理员', '通用-社团', '更新社团', '/smart-admin-api/position/update', 'net.lab1024.smartadmin.module.system.position.PositionController.updateJob', 'PositionUpdateDTO[{\"id\":19,\"positionName\":\"篮球社\",\"remark\":\"篮球协会以本着活跃校园气氛加强体育锻炼的目的，以普及篮球基础知识、承办各级篮球赛事、丰富学生课余文化生活为宗旨的社团组织。虽然我们也许不能让每一个会员都成为顶尖的篮球高手,但我们一定会让篮球协会的每一名成员从篮球运动中获得快乐,体会到篮球运动的无穷魅力.在这里你不但可以提高你的篮球技术,还可以交到许多知心朋友,每年我们都会组织各种各样的训练与比赛,加入篮球协会一定会让你的学生生活更加丰富多彩。\"}]', 1, NULL, '2021-01-13 13:29:11', '2021-01-13 13:29:11');
